
pc.script.createLoadingScreen((app) => {

    
    
    // Create the main loading screen div
    var div = document.createElement('div');
    div.style.backgroundColor = "#ffffff"; // Dark gray background
    div.style.position = "fixed";
    div.style.top = "0";
    div.style.left = "0";
    div.style.height = "100%";
    div.style.width = "100%";
    document.body.appendChild(div);

    const centerDiv=document.createElement('div');
    centerDiv.style.position = "absolute";
    centerDiv.style.top = "0px";
    centerDiv.style.left = "0px";
    centerDiv.style.bottom = "0px";
    centerDiv.style.right = "0px";
    centerDiv.style.display = "flex";
    centerDiv.style.alignItems = "center";
    centerDiv.style.justifyContent = "center";
    centerDiv.style.gap = "20px 0px";
    centerDiv.style.flexDirection = "column";
    div.appendChild(centerDiv);
    

    var logo = document.createElement('img');
    logo.src="data:image/jpeg;base64,";
    logo.style.width="200px"
    logo.style.marginTop="-70px"
    centerDiv.appendChild(logo);

    // Create the progress bar div, centered on the screen
    const progressBar = document.createElement('div');
    progressBar.style.width = "60%";
    progressBar.style.height = "6px";
    progressBar.style.borderRadius = "100px";
    progressBar.style.backgroundColor = "#d3d3d3";
    centerDiv.appendChild(progressBar);

    // Create the filler for the progress bar
    const progressFiller = document.createElement('div');
    progressFiller.style.height = "100%";
    progressFiller.style.borderRadius = "100px";
    progressFiller.style.backgroundColor = "#c20120"; // Green for the progress
    progressFiller.style.width = "0%";
    progressBar.appendChild(progressFiller);

    

    app.once('preload:start', function () {           
       
        
    });
    // Update the progress bar on preload progress
    app.on('preload:progress', (value) => {
        progressFiller.style.width = (value * 100) + '%';
    });
    app.once('preload:end', () => {
        app.off('preload:progress');
    });

    // Hide the loading screen when the app starts
    app.once('start', () => {
        document.body.removeChild(div);

        // var main_page=app.assets.find('main_page')
        // var html_string=main_page._resources[0];
        // html_string=html_string.replaceAll("external_images","https://raw.githubusercontent.com/BS-XR-23/KFC-Subway-Surfers/main/external_images");
        // html_string=html_string.replaceAll("external_fonts","https://raw.githubusercontent.com/BS-XR-23/KFC-Subway-Surfers/main/external_fonts");

        // div = document.createElement('div');
        // div.setAttribute("class", "fullscreen");
        // document.body.appendChild(div);
        // div.innerHTML=html_string;

    });
});